import React from "react";
import ContainedButtons from "./Button";
import CustomizedInputs from "./Input";

function Alert() {
  let urduc = document.getElementById(
    "mui-theme-provider-outlined-input"
  ).value;

  return alert(urduc);
}

export default Alert;
